import React from 'react'
import {Card,Input} from 'antd'
const  UserDetail=() =>{
  return (
    <div>
       <Card borderd={true} style={{ width:800,height:900 ,borderColor:'black',justifyContent:'center',alignContent:'center' ,display:'flex'}}>
        <Input placeholder='FirstName' style={{lineBreak:2}}/>
        <Input placeholder='LastName' />

       </Card>
    </div>
  )
}

export default UserDetail
